import ImageUtil_JPG from "./ImageUtil._jpg";
import {ImageFormat} from "../objs/projects";
import ndarray from "ndarray";
import FileUtil from "./FileUtil";

describe("JPG image helper", () => {

    test("Handles missing / malformed DataURL", () => {
        const imageDataURL = 'daft;';
        const img = new ImageUtil_JPG(ImageFormat.JPG, imageDataURL);
        const imageItem = img.buildImageItem(
            FileUtil.getFileParts('./sprites/hero/happy.jpg') ?? FileUtil.EMPTY_FILEPARTS,
            FileUtil.getFileBytes(imageDataURL, 'data:image/jpg;base64,') ?? ndarray([]),
        );

        expect(imageItem?.isEmpty).toEqual(true);
    });

    test("Reads from DataURL", () => {
        const imageDataURL = 'data:image/jpg;base64,';
        const jpg = new ImageUtil_JPG(ImageFormat.JPG, imageDataURL);
        const imageItem = jpg.buildImageItem(
            FileUtil.getFileParts('./sprites/hero/happy.jpg') ?? FileUtil.EMPTY_FILEPARTS,
            FileUtil.getFileBytes(imageDataURL, 'data:image/jpg;base64,') ?? ndarray([]),
        );

        expect(imageItem?.frames?.length).toEqual(1);
        expect(imageItem?.frames?.flat()[0].width).toEqual(300);
        expect(imageItem?.frames?.flat()[0].height).toEqual(300);
        expect(imageItem?.frames?.flat()[0].data?.length).toEqual(300 * 300 * 4);
    });

});
